import React from 'react'
import {Redirect, useHistory} from "react-router-dom";

const AccLogout = () => {
    
    localStorage.removeItem("token");
    localStorage.removeItem("profilephoto");
    
    alert("*Logout from GIMS successfully")
    return <Redirect to='/'  />
}

export default AccLogout
